import React from 'react';

const Search = () => {
  return (
    <div className='search'>
      <div className='search-form'>
        <input type='text'></input>
      </div>
      <div className='user-chat'>
        <img src='' alt=''/>
        <span>Vinay</span>
      </div>
    </div>
  )
}

export default Search;
